    "content": "# Work Experience\n\n---\n\nI wear a lot of hats and no matter which I am wearing what excites me is taking products from idea to implementation.\n\n> This is a <a href=\"https://en.wikipedia.org/wiki/Zooming_user_interface\" target=\"_blank\">zooming user interface</a>.\n> \n> - To zoom into a section, click a tile\n> - To go back, click the background"
